function datasearcher(searchvar)
{
    
if(list_the_data.length==0){
    for(var i=0;i<txt.length;i++)
    {
        if(txt[i].search(searchvar)!=-1)
        {
            //alert(txt[i])
            a=String(txt[i]);
            //alert("before1");
            //alert(a);
            if(count==0){
                list_the_data.push(a)
            }
            else
            {
                if(list_the_data.search(searchvar)!=-1)
                {
                    //alert(txt[i])
                    a=String(txt[i]);
                }
                else
                {
                    list_the_data.pop(searchvar)
                    //alert("removing")
                }

            }
        }
    }
}
else{
    for(i=0;i<(list_the_data).length;i++)
    {
        if((list_the_data[i]).search(searchvar)==-1){
            list_the_data.pop(list_the_data[i])
        }
    }
}
}


